  data: string
};
function LoginPage() {
  const [place, setPlace] = useState<responseType>({} as responseType);
  const getUserInput = async () => {
    return (await axios.get("http://localhost:5000/")).data;
  }
  return (
    <div className="form">
      <h1> GoTrip </h1>
      <p>{place.data}</p>
      <input type="text" placeholder="Search Places....." />
      <br/>
        <button id="search" type="button" onClick={getUserInput}> Search </button>
    </div>
  );
}
